window.bookSummaryJSON = "<p><b>How did Everson Croft end up with a talking cat?</b></p> <p>For that story, we have to go back to my early years as a wizard.</p> <p>With New York City in the dumps, the red light is back on in Times Square.</p> <p>Vampires, dark fae, and exotic entertainers have set up shop, promising pleasures beyond the wildest imagination. But now, male clients are turning up stiff - all over.</p> <p>I'm thinking supernatural predator, even as the clues keep drawing me back to Tabitha: a mysterious call girl who is 100 percent mortal.</p> <p>I need to solve this case before the killer feeds again, but damn if I'm not sinking deeper into Tabitha's dangerous and tantalizing world.</p> <p>Which is exactly what she seems to want...</p> <p><b><i>Siren Call </i></b><b>is the second prequel to the popular Prof Croft series. If you like occult action, spell-crackling suspense, and moments of heart, heroism, and all-out laughter, youâ€™ll love Prof Croft!</b></p>"; 
